searchData={"items":[{"type":"module","title":"CsvManager","doc":"CsvManager is a csv manipulator built with and made for elixir programs.","ref":"CsvManager.html"},{"type":"function","title":"CsvManager.csv_info/1","doc":"Display csv info.\n  Inputs `%CsvManager.Data`(the data structure)","ref":"CsvManager.html#csv_info/1"},{"type":"function","title":"CsvManager.get_column/2","doc":"Acess all the values from a column\n  Inputs `data` and `column_name`","ref":"CsvManager.html#get_column/2"},{"type":"function","title":"CsvManager.get_row/2","doc":"Returns a specific row from the data\n  Inputs `data` and `number` (number of the row)","ref":"CsvManager.html#get_row/2"},{"type":"function","title":"CsvManager.map_columns/1","doc":"Function to create map with columns-> column_index","ref":"CsvManager.html#map_columns/1"},{"type":"function","title":"CsvManager.parse_data/1","doc":"Function responsible for parsing the string into a list of lists.","ref":"CsvManager.html#parse_data/1"},{"type":"function","title":"CsvManager.read_csv/1","doc":"Main function to read a csv file.\n  Input `filename`(the file name) the module estipulates a \",\" for spliting rows","ref":"CsvManager.html#read_csv/1"},{"type":"function","title":"CsvManager.read_csv/2","doc":"Main function to read a csv file.\n  Inputs `filename`(the file name) and `sep`(character to split the rows)","ref":"CsvManager.html#read_csv/2"},{"type":"function","title":"CsvManager.read_file/2","doc":"Function that reads the file by a filename.\n  Inputs: `filename` (name of the file), `sep` (character that separates columns).","ref":"CsvManager.html#read_file/2"},{"type":"function","title":"Example - CsvManager.read_file/2","doc":"iex> CsvManager.read_file(\"example.csv\", \";\")\n    \"The example.csv couldn't be read by: enoent\"","ref":"CsvManager.html#read_file/2-example"},{"type":"module","title":"CsvManager.Data","doc":"","ref":"CsvManager.Data.html"}],"content_type":"text/markdown"}